import React, { Component } from 'react'

class Calendar extends React.Component{
    constructor(props) {
        super(props)
        this.state = {
            step: 0,
        }
    }

    images = ["date_1.png", "date_2.png", "date_3.png", "date_4.png", "date_5.png"]

    click = () => {
        const nextstep = this.state.step + 1
        if(nextstep <= this.images.length - 1){
          this.setState({
              step: nextstep,
          })
        }
    }

    render() {
        return (
            <div onClick={this.click}>
                <img src={this.images[this.state.step]}/>
            </div>
        )
    }
}

export default Calendar
